import React, { Component } from 'react'

export default class SubmitButton extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>                
                <div className="input-group mb-5">
                    <button type="submit" className="btn btn-primary">Sign In</button>
                </div>
            </div>
        )
    }
}
